import AnimatedLetters from '../AnimatedLetters';
import './index.scss';
import Loader from 'react-loaders';

const Contact = () => {
    return (
    <>
        <div className = 'container contact-page'></div>
        <div className = 'text-zone'>
            <h1>
                <AnimatedLetters strArray={['C']}/>
            </h1>
        </div>
        <Loader type="pacman" />
    </>)
};

export default Contact;
